    "narrative-report-crescent-lake-refuge-september-october-november-december-1944",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Crescent Lake
    National Wildlife Refuge outlines Refuge accomplishments from September through
    December of 1944. The report begins by summarizing the weather conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, and
    fish- is also covered. The Refuge development and maintenance section discusses
    physical developments and wildfires. Resource management is outlined; topics include
    grazing and fur harvesting. The public relations section of the report describes
    recreational uses, Refuge visitors, hunting, and fishing. A short narrative report
    of North Platte National Wildlife Refuge is attached, as well as some N-R forms.",nt"license_title":
